import SearchBar from "./SearchBar";

const Nav = ({ onSearch }) => {
  return (
    <div>
      <button onClick={() => onSearch}>RANDOM</button>
      <SearchBar onSearch={onSearch} />
    </div>
  );
};

export default Nav;
